"""Subclass of FramePrincipal, which is generated by wxFormBuilder."""import self as selfimport guiperfumesfrom FrameMarca import FrameMarcafrom FramePerfumes import FramePerfumesfrom FrameVolumes import FrameVolumesfrom FrameFixacoes import FrameFixacoesimport FrameEssencias# Implementing FramePrincipalclass FramePrincipal(guiperfumes.FramePrincipal):    def __init__(self, parent):        guiperfumes.FramePrincipal.__init__(self, parent)        self.FrameMarca = None        self.FramePerfume = None        self.FrameFixacoes = None        self.FrameEssencias = None        self.FrameVolumes = None    # Handlers for FramePrincipal events.    def fecharFramePrincipal(self, event):        self.Destroy()    def abrirFixacoes(self, event):        if not self.FrameFixacoes:            self.FrameFixacoes = FrameFixacoes(self)        self.FrameFixacoes.Show(True)    def abrirMarcas(self, event):        if not self.FrameMarca:            self.FrameMarca = FrameMarca(self)        self.FrameMarca.Show(True)    def AbrirEssencias(self, event):        if not self.FrameEssencias:            self.FrameEssencias = FrameEssencias.FrameEssencias(self)        self.FrameEssencias.Show(True)    def abrirVolumes(self, event):        if not self.FrameVolumes:            self.FrameVolumes = FrameVolumes(self)        self.FrameVolumes.Show(True)    def abrirPerfume(self, event):        if not self.FramePerfume:            self.FramePerfume = FramePerfumes(self)        self.FramePerfume.Show(True)    def fecharApp(self, event):        self.Show(False)        pass